import Auxlier from '../../hoc/Auxiler'
import styles from '../Layout/Layout.modules.css'


const layout = (props) => (
    <Auxlier>
        <div className={styles.Context}> TollBar, SideDrawer, BackDrop</div>
        <main>
            {props.children}
        </main>
    </Auxlier>
);

export default layout;
